const Flight = () => {
  const [data1, setData1] = useState("");

  const fetchData = () => {
    fetch("https://http://kayak.com/h/mobileapis/directory/airlines.me/api/")
      .then((response) => {
        return response.json();
      })
      .then((data) => {
        let people = data;
        console.log(people);
        setData1(people);
      });
  };

  return <div></div>;
};

export default Flight;
